
import { useCallback, useEffect, useRef, useState } from 'react'


import Box from '@mui/material/Box'
import { SxProps } from '@mui/material/styles'


export type VideoCamState = 'ready' | 'captured' | 'init'

interface VideoCamProps {
    top: number
    sx?: SxProps
    videoSource?: string
    onError?: (error: string) => void
    onLoad?: (sources: string[], captureFn: (delay: number) => void) => void
    onUpdateState: (state: VideoCamState) => void
}

const sound1 = new Audio('data:audio/wav;base64,')
const sound2 = new Audio('data:audio/wav;base64,')


export const VideoCam = (props: VideoCamProps) => {
    const { sx, videoSource, onError, onLoad, onUpdateState, top } = props

    const video = useRef<HTMLVideoElement>(null)
    const canvas = useRef<HTMLCanvasElement>(null)

    const [showCanvas, setShowCanvas] = useState<boolean>(false)
    const [counter, setCounter] = useState<number>()

    const timerID = useRef<number>()

    const [state, setState] = useState<VideoCamState>('init')

    useEffect(() => {
        onUpdateState(state)
    }, [state])

    useEffect(() => {
        (async () => {
            if (video.current === null) return

            try {
                const constraints: MediaStreamConstraints = {
                    audio: false,
                    video: {deviceId: (videoSource ? {exact: videoSource} : undefined)},
                }

                const stream = await navigator.mediaDevices.getUserMedia(constraints)

                video.current.srcObject = stream

                const sources = await navigator.mediaDevices.enumerateDevices()
                const videoSources = []

                for (const source of sources) {
                    if (source.kind !== 'videoinput') {
                        continue
                    }

                    videoSources.push(source.deviceId)
                }

                onLoad && onLoad(videoSources, delayCaptureCanvas)
            } catch (error) {
                onError && onError(`${error}`)
            }
        })()
    }, [videoSource])

    const playSound = useCallback((sound: HTMLAudioElement) => {
        sound.play()
    }, [])

    const delayCaptureCanvas = useCallback((delay: number) => {
        setCounter(delay)
        playSound(sound1)
        clearInterval(timerID.current)

        timerID.current = setInterval(() => {
            setCounter((prev) => {
                if (prev === 0) {
                    clearInterval(timerID.current)
                    captureCanvas()

                    setTimeout(() => {
                        setState('captured')
                    }, 1)

                    return undefined
                } else if (prev == 1) {
                    playSound(sound2)
                }

                playSound(sound1)

                return (prev || 0) - 1
            })
        }, 1000)
    }, [])

    useEffect(() => {
        return () => {
            clearInterval(timerID.current)
        }
    }, [])

    const handleClickVideo = useCallback(() => {
        if (counter !== undefined) return

        if (showCanvas) {
            if (confirm(' ?')) {
                setShowCanvas(false)
                setState('ready')

                return
            }
        }

        delayCaptureCanvas(5)
    }, [showCanvas, counter])


    const captureCanvas = useCallback(() => {
        const _canvas = canvas.current
        const _video = video.current

        if (_canvas === null || _video === null) return

        const ctx = _canvas.getContext('2d')

        if (ctx === null) return

        _canvas.width = _video.videoWidth
        _canvas.height = _video.videoHeight

        ctx.scale(-1, 1)
        ctx.translate(-_video.videoWidth, 0)
        ctx.drawImage(_video, 0, 0, _video.videoWidth, _video.videoHeight)


        setShowCanvas(true)
    }, [])

    return (
        <Box
            sx={{
                ...sx,
                position: 'absolute',
                width: '306px',
                height: '245px',
                overflow: 'hidden',
                cursor: 'pointer',
                top: top,
                left: 29,
            }}
            onClick={handleClickVideo}
        >
            {
                counter !== undefined && (
                    <Box
                        sx={{
                            position: 'absolute',
                            bottom: 10,
                            left: 10,
                            width: '50px',
                            height: '50px',
                            display: 'flex',
                            zIndex: 999,
                            backgroundColor: 'rgba(0, 0, 0, 0.5)',
                            color: 'white',
                            fontSize: '28px',
                            fontWeight: 'bold',
                            alignItems: 'center',
                            justifyContent: 'center',
                            borderRadius: '50%'
                        }}
                    >
                        {counter}
                    </Box>
                )
            }

            <canvas
                ref={canvas}
                style={{
                    width: '100%',
                    height: '100%',
                    display: showCanvas ? 'block' : 'none'
                }}
            />

            <video
                style={{
                    width: '100%',
                    height: '100%',
                    objectFit: 'cover',
                    transform: 'rotateY(180deg)',
                    display: showCanvas ? 'none' : 'block'
                }}
                ref={video}
                autoPlay
                playsInline
            />
        </Box>
    )
}